  const agentName = j["Literary Agent Name"] ?? "";
  const agentEmail = j["Agent Email to Email"] ?? "";

  // If eligibility output is nested under `output`, support that too
  const sendEmail = j?.output?.send_email ?? j?.send_email ?? "";
  const selectedEmail = j?.output?.selected_email ?? j?.selected_email ?? "";
  const reason = j?.output?.reason ?? j?.reason ?? "";

  const chatInput = `
You are a research assistant.

Your task:
Produce a high-quality, source-backed research brief about a literary agent for outreach personalization.

ABSOLUTE RULES (DO NOT VIOLATE):
- Use ONLY publicly available, professional information.
- Do NOT invent, infer, guess, or "write as if" you found something.
- If a detail is not explicitly stated in a public source, write "UNKNOWN".
- Every factual claim MUST be supported by a citation (a URL) in the "sources" array.
- Do NOT include private life, trauma, health, or family details.
- Return ONLY valid JSON matching the required schema. No markdown, no backticks.

RESEARCH SCOPE (GO DEEP, BUT STAY VERIFIABLE):
Look for and extract, when explicitly available:
1) Agency affiliation + role/title
2) Professional background (career history, prior roles, editorial experience, notable imprints)
3) Genres represented + specific interests (especially in nonfiction)
4) Submission preferences (what they want/avoid, formats, themes, tone)
5) Notable clients/books/deals (ONLY if explicitly listed publicly)
6) Public statements/interviews/podcasts/blogs/MWL comments (quote/paraphrase briefly)
7) LinkedIn / professional bio highlights (ONLY if a public LinkedIn page or official bio is cited)
8) Recent public news (ONLY if a credible source is cited: interviews, agency announcements, Publisher's Marketplace mentions if public, conference panels, etc.)
9) SAFE personalization angles that sound thoughtful because they are SPECIFIC and CITED

INPUT DATA:
- Primary information source: ${primarySource}
- Agent name: ${agentName}
- Agent email: ${agentEmail}
- Outreach decision: ${sendEmail}
- Selected email: ${selectedEmail}
- Reason for channel selection: ${reason}

OUTPUT SCHEMA (STRICT):
Return exactly ONE JSON object with EXACTLY these keys:
{
  "agent_email": "string",
  "agent_name": "string",
  "agency": "string",
  "professional_background": "string",
  "genres_represented": ["string"],
  "notable_clients_or_books": ["string"],
  "public_statements_or_interviews": [
    {
      "context": "string",
      "summary": "string",
      "source": "string"
    }
  ],
  "personalization_angles": ["string"],
  "sources": ["string"]
}

FORMATTING RULES:
- If something is unknown, use "UNKNOWN" (or ["UNKNOWN"] for arrays).
- For "public_statements_or_interviews":
  - Each item MUST be an object with keys: context, summary, source
  - "source" MUST be a URL string
  - If none found, return:
    [{"context":"UNKNOWN","summary":"UNKNOWN","source":"UNKNOWN"}]
- "sources" must be a deduplicated list of URLs used. Do NOT include sources you didn't use.
