QUALITY BAR:
- Aim for depth: include prior roles, editorial taste, named interests, and concrete details when publicly stated.
- Do NOT fabricate LinkedIn/books/news. If you cannot find them, write "UNKNOWN" and do not fake it.
`.trim();


  return {
    json: {
